'Branding free'=>'Frîvs no zîmoliem',
'Branding Free is a special feature that allows you to change the links in the footer of panels and signup form from "Powered by %s" to your own text and link.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Brīvs no zīmoliem ir speciāla iespēja, kas ļauj jums izmainīt saites paneļa apakšā no "Powered by %s" uz jūsu pašu tekstu un saiti.<br/><a href="%s" target="_blank">Vairāk informācijas meklējiet mūsu Zinību bāzē</a>',
'Commission Groups'=>'Komisiju grupas',
'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Komisiju grupas ļauj jums iestatīt dažādas komisijas dažādiem lietotājiem tai pašai kampaņai.<br/><a href="%s" target="_blank">Vairāk informācijas meklējiet mūsu Zinību bāzē</a>',
'CPM commissions'=>'CPM komisijas',
'CPM (cost per mille) commissions are a special type of commissions that are rewarded for 1000 impressions, which means for displaying your banners 1000 times.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'CPM (cost per mille) komisijas ir speciāls komisiju tips, kas maksā par 1000 impresijām, kas nozīmē, rādot jūsu banerus  1000 reizes.<br/><a href="%s" target="_blank">Vairāk informācijas meklējiet mūsu Apmācībās</a>',
'Forced matrix allows you to limit to the number of referrals of subaffiliates any affiliate can refer. It means that every affiliate can have only specified number of children. <a href="%s" target="_blank">More details read in our Knowledge Base</a>'=>'Forced Matrix ļauj jums ierobežot referāļu vai apakšpartneru skaitu, cik viens partneris var piesaistīt. Tas nozīmē, ka katram partnerim var būt tikai noteikts skaits apakšpartneru. <a href="%s" target="_blank">Vairāk informācijas meklējiet mūsu Zinību bāzē</a>',
'Hosting of %s on  %s servers.'=>'Hostings  %s uz  %s serveriem.',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Vairākas valūtas ļauj jums izsekot pārdošanas vairākās valūtās.<br/><a href="%s" target="_blank">Vairāk informācijas meklējiet mūsu Zinību bāzē</a>',
'Multiple merchants'=>'Vairaki tirgotāji',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Pēc noklusējuma, visas kampaņas %s ir publiskas, kas nozīmē, ka visi partneri var apskatīt un reklamēt tās. Privāto kampaņu iespēja ļauj jums izveidot privātas kampaņas, kuras būs redzamas tikai izvēlētiem partneriem.<br/><a href="%s" target="_blank">Vairāk informācijas meklējiet mūsu Zinību bāzē</a>',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Tas ļauj jums izmantot speciālu reklāmas materiālu izveidi - pārzīmolotas e-grāmatas. Jūs varat izveidot savu PDF grāmatu un augšuplādēt to %s.jūsu partneri automātiski saņems savu pārzīmoloto grāmatas kopiju, ar viņu vārdu, partneru saitēm, tekstiem utt. Atkrīt nepieciešamība iegādāties kādu speciālu programmatūru, lai to paveiktu. Viss process tiek paveikts fona režīmā.<br/><a href="%s" target="_blank">%s</a>',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Atkārtotās komisijas ļauj jums gandarīt jūsu partnerus par atkārtotiem maksājumiem, piemēram par hostingu vai biedru naudām. <br/><a href="%s" target="_blank">Vairāk informācijas meklējiet mūsu Zinību bāzē</a>',
